import React from 'react';
import {
  BrowserRouter as Router,
  Routes,
  Route,
} from 'react-router-dom';

import Home from "./components/home.js";
import Writing from "./components/writing.js";

function App() {
  return (
    <Router>
      <>
        <br />
        <Routes>
          <Route
            exact
            path="/"
            element={<Dashboard />}
          />
          <Route
            path="/createAccount"
            element={<CreateAccountForm />}
          />
          <Route
            path="/login"
            element={<LoginForm />}
          />
          <Route
            path="/events"
            element={<Events />}
          />
          <Route
            path="/friends"
            element={<Friends />}
          />
          <Route
            path="/conversations"
            element={<Chat />}
          />
          <Route
            path="/profile"
            element={<Profile />}
          />
        </Routes>
      </>
    </Router>
  );
}

export default App;
